func lengthOfLongestSubstring(s string) int {
	var (
		strLen        = len(s)
		subStr        = ""
		subStrMapping = map[byte]struct{}{}
		leftIdx       = 0
		maxLen        = 0
	)

	// move sub string to right
	for i := 0; i < strLen; i++ {
		char := s[i]
		for {
			if _, ok := subStrMapping[char]; ok {
				delete(subStrMapping, s[leftIdx])
				leftIdx++
				subStr = s[leftIdx : i+1]
			} else {
				subStrMapping[char] = struct{}{}
				break
			}
		}
		subStr = s[leftIdx : i+1]
		if len(subStr) > maxLen {
			maxLen = len(subStr)
		}
	}

	return maxLen
}

